import React from 'react';
import './Info.css';
const Info = () => {
  return (
    <div className='info-container'>
        <div className='info'>
        <h1>"Nuestra naturaleza esta en la acción. El reposo presagia la muerte"
          <p>-Séneca</p>
        </h1>
        </div>

    </div>
  )
}

export default Info
